import React, { useState } from "react";
import { render } from "react-dom";
import Timeline from "react-visjs-timeline";
import moment from "moment";
import "./styles.css";

const options = {
  width: "100%",
  height: "90vh",
  showMajorLabels: true,
  showCurrentTime: true,
  zoomMin: 1000000,
  type: "range",
  orientation: "top",
  stack: true,
  editable: true,
};

const groups = [
  {
    id: 1,
    content: "PRODUCT",
    nestedGroups: [11, 12],
    showNested: false,
  },
  {
    id: 2,
    content: "FLIGHTS",
    nestedGroups: [13],
    showNested: false,
  },
  {
    id: 3,
    content: "TEST-AK",
    nestedGroups: [14, 15],
    showNested: false,
  },
  {
    id: 11,
    content: "PRODUCT QA-1",
  },
  {
    id: 12,
    content: "PRODUCT QA-2",
  },
  {
    id: 13,
    content: "FLIGHTS 1",
  },
  {
    id: 14,
    content: "TEST-AK 1",
  },
  {
    id: 15,
    content: "TEST-AK 2",
  },
];

const items = [
  {
    id: 1,
    group: 1,
    content: "Item 1",
    start: moment().startOf("day"),
    end: moment().startOf("day").add(5, "days"),
    title: "Item 1 Tooltip",
  },
  {
    id: 2,
    group: 2,
    content: "Item 2",
    start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 2 Tooltip",
  },
  {
    id: 3,
   group: 3,
    content: "Item 3",
    start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  },

  {
    id:4,
    group:11,
       content:"Item 21",
       start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  },

  {
    id:4,
    group:11,
       content:"Item 21",
       start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  },

  {
    id:4,
    group:11,
       content:"Item 21",
       start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  },

  {
    id:4,
    group:11,
       content:"Item 21",
       start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  },

  {
    id:4,
    group:11,
       content:"Item 21",
       start: moment().startOf("day").add(2, "days"),
    end: moment().startOf("day").add(7, "days"),
    title: "Item 3 Tooltip",
  }
];

const App = () => {
  const [tooltipContent, setTooltipContent] = useState("");
  const [tooltipPosition, setTooltipPosition] = useState({ x: 0, y: 0 });

  const handleMouseEnter = (event, content) => {
    setTooltipContent(content);
    setTooltipPosition({ x: event.clientX, y: event.clientY });
  };

  const handleMouseLeave = () => {
    setTooltipContent("");
  };

  return (
    <div className="timeline">
      <Timeline
        options={options}
        items={items}
        groups={groups}
        // Add event listeners for tooltip
        clickHandler={(event) =>
          handleMouseEnter(event, "Click tooltip content")
        }
        onMouseOver={(event, properties) => {
          const hoveredItemId = properties.item;
          const hoveredItem = items.find((item) => item.id === hoveredItemId);
          if (hoveredItem) {
            const { title } = hoveredItem;
            handleMouseEnter(event, title);
          }
        }}
        onMouseOut={handleMouseLeave}
      />
      {/* Render the tooltip */}
      {tooltipContent && (
        <div
          className="tooltip"
          style={{
            position: "fixed",
            top: tooltipPosition.y + 10,
            left: tooltipPosition.x + 10,
            pointerEvents: "none",
            zIndex: 9999,
            backgroundColor: "#fff",
            padding: "5px",
            border: "1px solid #ccc",
            borderRadius: "4px",
          }}
        >
          <div>{tooltipContent}</div>
        </div>
      )}
    </div>
  );
};

render(<App />, document.getElementById("root"));
